import Box from "@mui/material/Box";
import { TextField, Grid } from "@mui/material";

export default function SearchForm() {
    return (
        <Box>
            <Grid item xs={6} md={8}>
                <TextField id="tid-input" label="TID or XTID" />
            </Grid>
        </Box>
    );
}
